import React from 'react';
import { Link } from 'react-router-dom'
function HeaderLayout(){
    return(
        <header style={hearderStyle}>
            <h1> To Do List</h1>
            <Link to="/">Home</Link> | <Link to="/about">About</Link>
        </header> 
    )
}
const hearderStyle = {
    background : '#333',
    color:'#fff',
    textAlign:'center',
    padding: '10px'
}
export default HeaderLayout;
